data _null_;
    infile logfile;
    input;
    putlog _infile_;  
run;

filename logfilex temp;

proc printto log=logfilex new;
run;

%macro _Check;
    data _log;
        infile logfile delimiter='00'x MISSOVER DSD lrecl=32767;
        firstobs=1;
        format logtext $500.;
        input  logtext $ ;
        putlog _infile_;  
    run;

    data _checklog;
        set _log;
        if index(upcase(logtext),'MERROR')^=0 then delete;
        if index(upcase(logtext),'MERGENOBY=ERROR')^=0 then delete;
        if index(logtext,'index(upcase(logtext),')^=0 then delete;

        length key $50.;    
        if logtext=:'ERROR' then key='Error';
        else if logtext=:'WARNING' then key='Warning';
        else if upcase(logtext)=:'INFO: THE VARIABLE' then key='Info: the variable';
        else if upcase(logtext)=:'NOTE: CHARACTER' then key='Character';
        else if upcase(logtext)=:'NOTE: NUMERIC' then key='Numeric';
        else if upcase(logtext)=:'NOTE: AT LEAST' then key='At least';
        else if upcase(logtext)=:'NOTE: DIVISION' then key='Division';
        else if upcase(logtext)=:'NOTE: MATHEMATICAL' then key='Mathematical';
        else if upcase(logtext)=:'NOTE: MERGE' then key='Merge';
        else if upcase(logtext)=:'NOTE: MISSING' then key='Missing';
        else if upcase(logtext)=:'NOTE: NOSPOOL' then key='Nopool';
        else if upcase(logtext)=:'NOTE: VARIABLE' then key='Note: Variable';
        else if upcase(logtext)=:'NOTICE:' then key='Notice';
        else if index(upcase(logtext),'INVALID')^=0 then key='Invalid';
        else if index(upcase(logtext),'UNINI')^=0 then key='Uninitialized'; 
        else if index(upcase(logtext),'OUTSIDE THE AXIS RANGE')^=0 then key='Outside';
        else if index(upcase(logtext),'REACHED PAST THE END OF A LINE')^=0 then key='End';
        else if index(upcase(logtext),'ONE OR MORE LINES WERE TRUNCATED')^=0 then key='Truncated';
        else if index(upcase(logtext),'NOT POSITIVE DEFINITE')^=0 then key='Not positive definite';
        else if index(upcase(logtext),'QUERY REQUIRES REMERGING')^=0 then key='Query requires remerging';
        else if index(upcase(logtext),'CARTESIAN PRODUCT JOINS THAT CAN NOT BE OPTIMIZED')^=0 then key='Cartesian product joins';
        else if index(upcase(logtext),'DONTDO')^=0 then key='Dontdo';
        else if index(upcase(logtext),'FATAL:')^=0 then key='FATAL:';
        else if index(upcase(logtext),'MEANING OF AN IDENTIFIER')^=0 then key='MEANING';
        else if index(upcase(logtext),'COULD NOT BE FOUND OR LOADED')^=0 then key='Could not';        

        if key^='';

        blank='';
        n1=_n_;
    run;

    data _NULL_;
        if 0 then set _checklog nobs=n;
        call symputx('nrows',n);
        stop;
    run;

    title;

    %if &nrows=0 %then %do;
        data _checklog;
            logtext="  ";
        run;

        proc report data=_checklog nocenter split='|' nowd missing spacing=0;
            column (logtext);
            define logtext / display " " width=86 flow left spacing=0;
            title3 color=blue "  >>>>>>>>>> CONGRATULATIONS!! NO PROBLEMS WERE FOUND in &_CLIENTTASKLABEL <<<<<<<<<< ";
        run;
    %end;

    %else %do;
         proc report data=_checklog headline nocenter split='|' nowd missing spacing=0;
         column (n1 blank key logtext);
         define n1     / order noprint;
         define blank   / display " " width=3 flow left spacing=0;
         define key     / display "Key Message" width=20 flow left spacing=0;
         define logtext / display "Log Message" width=86 flow left spacing=0;
         break before n1/skip;
         title3 color=RED "  >>>>>>>>>> THE FOLLOWING PROBLEMS WERE FOUND IN &_CLIENTTASKLABEL <<<<<<<<<< ";
         run;
    %end;

    proc sql;
        drop table _log, _checklog;
    quit;

    title; 

%mend _Check;

%_Check;

proc printto log=log;  
run;

** reset syscc to 0;
%let syscc=0;

